#include <stdio.h>
#include <stdlib.h>

struct node {
	int data;
	node* next;
};
//插入节点
void ds_init(node **pnode) {
	int item;
	node* temp;
	node* target;
	printf("请输入节点的值，输入0完成初始化");
	while (1) {
		scanf("%d", &item);
		fflush(stdin);
		if (item == 0) {
			return;
		}
		if ((*pnode) == NULL) {
			*pnode = (node*)malloc(sizeof(node));
			if (!(*pnode)) {
				exit(0);
			}
			(*pnode)->data = item;
			(*pnode)->next = *pnode;
		}
		else {
			for (target = (*pnode); target->next != (*pnode); target = target->next);
			temp = (node*)malloc(sizeof(node));
			if (!temp) {
				exit(0);
			}
			temp->data = item;
			temp->next = *pnode;
			target->next = temp;
		}
	}
}







void ds_insert(node** pnode, int i) {
	node* temp;
	node* target;
	node* p;
	int item;
	int j=1;
	printf("请输入插入节点的值");
	scanf("%d", &item);
	if (i == 1) {
		//新插入的节点作为第一个节点
		temp = (node*)malloc(sizeof(node));
		if (!temp) {
			exit(0);
		}
		temp->data = item;
		for (target = (*pnode); target->next != (*pnode); target = target->next);
		temp->next = (*pnode);
		target->next = temp;
		*pnode = temp;
	}
	else {
		target->next = (*pnode);
		for(; j < (i - 1); j++) {
			target = target->next;
		}
		temp = (node*)malloc(sizeof(node));
		if (!temp) {
			exit(0);
		}
		temp->data = item;
		p = target->next;
		target->next = temp;
		temp->next = p;
	}
}


void ds_delete(node** pnode, int i) {
	node* temp;
	node* target;
	int j = 1;
	if (i == 1) {
		for (target = (*pnode); target->next != (*pnode); target = target->next);
		temp= (*pnode);
		(*pnode)=(*pnode)->next;
		target->next = *pnode;
		free(temp);
	}
	else {
		target->next = (*pnode);
		for (; j < (i - 1); j++) {
			target = target->next;
		}
		temp = target->next;
		target->next = temp->next;
		free(temp); 
	}
}

#include <stdio.h>
#include <stdlib.h>
#include <string>
#include <format>
#include <math.h>


struct Linklist{
	int num;
	Linklist* next;
};

bool ListInsert(Linklist *L,int num,int i) {
	int j;
	Linklist* p;
	Linklist* s;
	p = L;
	j = 1;
	while (p && j<i) {
		p = p->next;
		j++;
	}
	if (!p || j > i) {
		return 0;
	}
	s = (Linklist*)malloc(sizeof(Linklist*));
	if (!s) {
		return 0;
	}
	s->num = num;
	s->next=p->next;
	p->next = s;
}


bool ListDelete(Linklist* L,int i) {
	int j;
	Linklist* p;
	p = L;
	j = 1;
	while (p && j < i) {
		p = p->next;
		j++;
	}
	if (!(p->next) || j > i) {
		return 0;
	}
	p->next = p->next->next;	
}


bool ClearList(Linklist* L) {
	Linklist* p;
	Linklist* q;
	p = L;
	while (p) {
		q = p->next;
		free(p);
		p = q;
	}
}

typedef struct DFA_node {
    int index;              // 状态索引
    bool is_end;            // 是否是结束状态
    bool is_first;          // 是否是起始状态
    int if_Next_Zero;       // 下一个状态是0的转移
    int if_Next_One;        // 下一个状态是1的转移
    struct DFA_node* next;  // 链表中的下一个节点
} DFA_node, * DFA_link;

void printList(DFA_link L)
{
    //printf("\t0\t1\n");
    printf("      0\t1\n");
    DFA_link p = L->next;
    while (p != NULL) {
        if (p->is_first) {
            printf("(s)");
        }
        if (p->is_end) {
            printf("(e)");
        }

        printf("q%d\tq%d\tq%d\n", p->index, p->if_Next_Zero, p->if_Next_One);
        p = p->next;
    }
}

#include<sys/types.h>
#include<stdio.h>
#include<unistd.h>
#include <sys/wait.h>

int main()
{
    pid_t pid1 = fork();
    if(pid1 == 0){//child1
        printf("child1 print:b\n");
    }
    if(pid1>0){
        wait(NULL);
        pid_t pid2 = fork();
        if(pid2 == 0){///child2
            printf("child2 print:c\n");
        }
        if(pid2 >0){//parent
            wait(NULL);
            printf("parent print:a\n");
        }
    }
    return 0;
}

#include <sys/types.h>
#include <stdio.h>
#include <unistd.h>
#include <sys/wait.h>

int main()
{
    pid_t pid = fork();
    if (pid < 0){
        perror("Fork failed");
        return 1;
    }
    if (pid == 0){// child{
        printf("Child process (PID: %d)\n", getpid());
        execl("/bin/ls", "ls", "-l", NULL);
        perror("exec failed");
        return 1;
    }
    else{//parent 
        wait(NULL); 
        printf("parent process (PID: %d)\n",getpid());
    }
    return 0;
}

